import logo from "./logo.svg";
import "./App.css";
import NavBar from "./NavBar";
import { Route, Routes } from "react-router-dom";
import MainPage from "./MainPage";
import { Grid } from "@mui/material";

function App() {
  return (
    <Grid className="App">
        <NavBar />
        <Routes>
          <Route
            exact
            path="/"
            element={<MainPage/>}
          />
          <Route
            exact
            path="/product/list"
            // element={}
          />
          <Route
            exact
            path="/bookmark"
            // element={}
          />
        </Routes>
      <footer></footer>
    </Grid>
  );
}

export default App;
